const FileUpload = () => {
    return (
        <div className="file-upload container">
            <h2>Upload File</h2>
            <div className="file-select">
                <button>Browse Files</button>
                <p><mark>ChosenFilePath</mark></p>
            </div>
        </div>
    )
}

export default FileUpload
